import React from 'react';
import './Faculties.css'; // Make sure to create a CSS file for styling
import { Card } from 'react-bootstrap';

// Import images for each department under FoCM faculty
import DepartmentOneImg from '../../path/to/image1.jpg';
import DepartmentTwoImg from '../../path/to/image2.jpg';
// ... other department images

const departments = [
    {
        id: 1,
        img: [DepartmentOneImg],
        title: 'Department One Title',
        description: 'Description for Department One...'
    },
    {
        id: 2,
        img: [DepartmentTwoImg],
        title: 'Department Two Title',
        description: 'Description for Department Two...'
    },
    // ... other departments
];

function FoCM() {
    return (
      <div className='faculties-page'>
          {/* Header with specific image or content for FoCM */}
          <header className='height-75'>
              {/* Content specific to FoCM faculty */}
          </header>
  
          <div className='container py-5'>
              <div className='row g-4'>
                  {departments.map((department) => (
                      <div key={department.id} className='col-lg-6'>
                          <Card className='text-white shadow scale-hover-effect'>
                              <Card.Img src={department.img} />
                              <Card.ImgOverlay className='d-flex flex-column align-items-center justify-content-center p-md-5'>
                                  <Card.Title className='fs-1 text-danger'>{department.title}</Card.Title>
                                  <Card.Text className='text-center'>{department.description}</Card.Text>
                              </Card.ImgOverlay>
                          </Card>
                      </div>
                  ))}
              </div>
          </div>
          {/* Additional content if needed */}
      </div>
    )
  }
  
export default FoCM;
